import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaCode, FaDatabase, FaChartLine, FaUsers, FaCertificate, FaGlobe } from 'react-icons/fa';

const SkillsContainer = styled.section`
  padding: 120px 0;
  background: linear-gradient(135deg, #1e3a8a 0%, #3730a3 50%, #7c3aed 100%);
  color: white;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: 
      radial-gradient(circle at 20% 80%, rgba(124, 58, 237, 0.4) 0%, transparent 50%),
      radial-gradient(circle at 80% 20%, rgba(59, 130, 246, 0.4) 0%, transparent 50%),
      radial-gradient(circle at 40% 40%, rgba(168, 85, 247, 0.3) 0%, transparent 50%);
    z-index: 1;
  }
`;

const Container = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 0 2rem;
  position: relative;
  z-index: 2;
`;

const SectionHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: 80px;
`;

const SectionTitle = styled.h2`
  font-size: clamp(2.5rem, 5vw, 3.5rem);
  font-weight: 700;
  color: white;
  margin-bottom: 20px;
  position: relative;

  &::after {
    content: '';
    position: absolute;
    bottom: -15px;
    left: 50%;
    transform: translateX(-50%);
    width: 80px;
    height: 4px;
    background: linear-gradient(90deg, #8b5cf6, #3b82f6);
    border-radius: 2px;
  }
`;

const SectionSubtitle = styled.p`
  font-size: clamp(1.1rem, 2.5vw, 1.3rem);
  color: rgba(255, 255, 255, 0.9);
  max-width: 700px;
  margin: 0 auto;
  line-height: 1.7;
  font-weight: 400;
`;

const SkillsLayout = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 4rem;
  margin-bottom: 80px;

  @media (max-width: 1024px) {
    grid-template-columns: 1fr;
    gap: 3rem;
  }
`;

const SkillCategory = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border-radius: 30px;
  padding: 3rem;
  border: 1px solid rgba(255, 255, 255, 0.2);
  box-shadow: 0 25px 50px rgba(0, 0, 0, 0.2);
  position: relative;
  overflow: hidden;
  transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(90deg, #8b5cf6, #3b82f6);
  }

  &:hover {
    transform: translateY(-8px);
    background: rgba(255, 255, 255, 0.15);
    box-shadow: 0 35px 70px rgba(0, 0, 0, 0.3);
  }
`;

const CategoryHeader = styled.div`
  display: flex;
  align-items: center;
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const CategoryIcon = styled.div`
  width: 70px;
  height: 70px;
  border-radius: 20px;
  background: linear-gradient(135deg, #8b5cf6, #3b82f6);
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 28px;
  box-shadow: 0 15px 35px rgba(139, 92, 246, 0.3);
  flex-shrink: 0;
`;

const CategoryTitle = styled.h3`
  font-size: 1.75rem;
  font-weight: 700;
  color: white;
  margin: 0;
`;

const SkillItem = styled.div`
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  padding-bottom: 1.5rem;
  margin-bottom: 1.5rem;

  &:last-child {
    border-bottom: none;
    padding-bottom: 0;
    margin-bottom: 0;
  }
`;

const SkillHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 1rem;
`;

const SkillName = styled.span`
  font-size: 1.1rem;
  font-weight: 600;
  color: white;
`;

const SkillLevel = styled.span`
  font-size: 0.9rem;
  font-weight: 500;
  color: #8b5cf6;
`;

const ProgressBarBackground = styled.div`
  width: 100%;
  height: 8px;
  background: rgba(255, 255, 255, 0.1);
  border-radius: 4px;
  overflow: hidden;
`;

const SkillProgress = styled(motion.div)`
  height: 100%;
  background: linear-gradient(90deg, #8b5cf6, #3b82f6);
  border-radius: 4px;
  transform-origin: left;
`;

const CertificationsSection = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border-radius: 30px;
  padding: 3rem;
  border: 1px solid rgba(255, 255, 255, 0.2);
  box-shadow: 0 25px 50px rgba(0, 0, 0, 0.2);
  margin-bottom: 60px;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(90deg, #8b5cf6, #3b82f6);
  }
`;

const CertificationsTitle = styled.h3`
  font-size: 2rem;
  font-weight: 700;
  color: white;
  text-align: center;
  margin-bottom: 3rem;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 1rem;
`;

const CertificationsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
`;

const CertificationCard = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  border-radius: 20px;
  padding: 2rem;
  border: 1px solid rgba(255, 255, 255, 0.2);
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    background: rgba(255, 255, 255, 0.15);
    box-shadow: 0 15px 35px rgba(0, 0, 0, 0.2);
  }
`;

const CertificationName = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: white;
  margin-bottom: 0.5rem;
`;

const CertificationIssuer = styled.p`
  font-size: 0.9rem;
  color: #8b5cf6;
  font-weight: 500;
  margin-bottom: 0.25rem;
`;

const CertificationDate = styled.p`
  font-size: 0.8rem;
  color: rgba(255, 255, 255, 0.7);
`;

const LanguagesSection = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border-radius: 30px;
  padding: 3rem;
  border: 1px solid rgba(255, 255, 255, 0.2);
  box-shadow: 0 25px 50px rgba(0, 0, 0, 0.2);
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(90deg, #8b5cf6, #3b82f6);
  }
`;

const LanguagesTitle = styled.h3`
  font-size: 2rem;
  font-weight: 700;
  color: white;
  text-align: center;
  margin-bottom: 3rem;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 1rem;
`;

const LanguagesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 2rem;
`;

const LanguageCard = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  border-radius: 20px;
  padding: 2rem;
  text-align: center;
  border: 1px solid rgba(255, 255, 255, 0.2);
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    background: rgba(255, 255, 255, 0.15);
    box-shadow: 0 15px 35px rgba(0, 0, 0, 0.2);
  }
`;

const LanguageName = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: white;
  margin-bottom: 0.5rem;
`;

const LanguageLevel = styled.p`
  font-size: 0.9rem;
  color: #8b5cf6;
  font-weight: 500;
`;

const Skills = () => {
  const [skillsData, setSkillsData] = useState(null);
  const { ref, inView } = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  useEffect(() => {
    const fetchSkillsData = async () => {
      try {
        const response = await fetch('/api/portfolio/skills');
        if (response.ok) {
          const data = await response.json();
          setSkillsData(data);
        }
      } catch (error) {
        console.error('Error fetching skills data:', error);
        // Fallback data
        setSkillsData({
          technical: [
            { name: "Product Strategy", level: 95 },
            { name: "Data Analytics", level: 90 },
            { name: "User Experience Design", level: 85 },
            { name: "Agile/Scrum", level: 90 },
            { name: "SQL & Databases", level: 80 },
            { name: "Python", level: 75 }
          ],
          soft: [
            { name: "Leadership", level: 95 },
            { name: "Communication", level: 90 },
            { name: "Problem Solving", level: 95 },
            { name: "Team Management", level: 90 },
            { name: "Strategic Thinking", level: 95 },
            { name: "Stakeholder Management", level: 85 }
          ]
        });
      }
    };
    fetchSkillsData();
  }, []);

  if (!skillsData) return <div>Loading...</div>;

  const certifications = [
    {
      name: "Certified Scrum Product Owner (CSPO)",
      issuer: "Scrum Alliance",
      date: "2023"
    },
    {
      name: "Google Analytics Individual Qualification",
      issuer: "Google",
      date: "2022"
    },
    {
      name: "Product Management Certification",
      issuer: "Product School",
      date: "2021"
    }
  ];

  const languages = [
    { name: "English", level: "Native" },
    { name: "Hindi", level: "Native" },
    { name: "Gujarati", level: "Fluent" }
  ];

  return (
    <SkillsContainer id="skills">
      <Container ref={ref}>
        <SectionHeader
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          <SectionTitle>Skills & Expertise</SectionTitle>
          <SectionSubtitle>
            A comprehensive toolkit for building exceptional products
          </SectionSubtitle>
        </SectionHeader>

        <SkillsLayout>
          <SkillCategory
            initial={{ opacity: 0, x: -50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <CategoryHeader>
              <CategoryIcon>
                <FaCode />
              </CategoryIcon>
              <CategoryTitle>Technical Skills</CategoryTitle>
            </CategoryHeader>

            {skillsData.technical?.map((skill, index) => (
              <SkillItem key={index}>
                <SkillHeader>
                  <SkillName>{skill.name}</SkillName>
                  <SkillLevel>{skill.level}%</SkillLevel>
                </SkillHeader>
                <ProgressBarBackground>
                  <SkillProgress
                    initial={{ scaleX: 0 }}
                    animate={inView ? { scaleX: skill.level / 100 } : {}}
                    transition={{ duration: 1, delay: 0.5 + index * 0.1 }}
                  />
                </ProgressBarBackground>
              </SkillItem>
            ))}
          </SkillCategory>

          <SkillCategory
            initial={{ opacity: 0, x: 50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <CategoryHeader>
              <CategoryIcon>
                <FaUsers />
              </CategoryIcon>
              <CategoryTitle>Soft Skills</CategoryTitle>
            </CategoryHeader>

            {skillsData.soft?.map((skill, index) => (
              <SkillItem key={index}>
                <SkillHeader>
                  <SkillName>{skill.name}</SkillName>
                  <SkillLevel>{skill.level}%</SkillLevel>
                </SkillHeader>
                <ProgressBarBackground>
                  <SkillProgress
                    initial={{ scaleX: 0 }}
                    animate={inView ? { scaleX: skill.level / 100 } : {}}
                    transition={{ duration: 1, delay: 0.7 + index * 0.1 }}
                  />
                </ProgressBarBackground>
              </SkillItem>
            ))}
          </SkillCategory>
        </SkillsLayout>

        <CertificationsSection
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.6 }}
        >
          <CertificationsTitle>
            <FaCertificate />
            Certifications
          </CertificationsTitle>

          <CertificationsGrid>
            {certifications.map((cert, index) => (
              <CertificationCard
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.6, delay: 0.8 + index * 0.1 }}
                whileHover={{ scale: 1.02 }}
              >
                <CertificationName>{cert.name}</CertificationName>
                <CertificationIssuer>{cert.issuer}</CertificationIssuer>
                <CertificationDate>{cert.date}</CertificationDate>
              </CertificationCard>
            ))}
          </CertificationsGrid>
        </CertificationsSection>

        <LanguagesSection
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.8 }}
        >
          <LanguagesTitle>
            <FaGlobe />
            Languages
          </LanguagesTitle>

          <LanguagesGrid>
            {languages.map((language, index) => (
              <LanguageCard
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.6, delay: 1.0 + index * 0.1 }}
                whileHover={{ scale: 1.02 }}
              >
                <LanguageName>{language.name}</LanguageName>
                <LanguageLevel>{language.level}</LanguageLevel>
              </LanguageCard>
            ))}
          </LanguagesGrid>
        </LanguagesSection>
      </Container>
    </SkillsContainer>
  );
};

export default Skills;
